import React from 'react';
import { Link, useHistory } from "react-router-dom";



const About = () => {
    return (
        <div className='topicInfo'>

            <h2>Skills:</h2>
            <p>- Problem-solving</p>
            <p>- Management and organization</p>
            <p>- Quick-to-learn person</p>
            <p>- Team Work</p>
            <p>- Communication</p>
            <p>- Creativity</p>
        </div>
    );
};

export default About;
